SELECT AVG(interest) AS average_interest_rate 
FROM deposits 
WHERE bal > 100000;

SELECT MIN(tran_amt) AS min_transaction_amount 
FROM transactions 
WHERE DATE_TRUNC('month', tran_dt) = DATE_TRUNC('month', CURRENT_DATE);

SELECT COUNT(*) AS December_account_creations 
FROM accounts 
WHERE EXTRACT(MONTH FROM created_at) = 12;
